plot(X, Y, S):-

	%format(S, '\\node[draw] (~w) at (~w,~w){~w};\n', [N,X,Y,N]),
	write(S, '\\fill[blue!80] ('),
	format(S, '~w', X),
	write(S,','),
	format(S, '~w', Y),
	write(S, ') circle (0.1);\n').
plot.


readData(In, L):-
  read_term(In, H, []),
  (   H == end_of_file
  ->  L = []
  ;   L = [H|T],
      readData(In,T)
  ).

length_1(0,[]).
length_1(L+1, [H|T]) :- length_1(L,T).



search(P, Data, Len):-

	write(pp(P, Len)), nl,

		
	findall(S,member([S|L],Data),SL),
	findall(L, member([S|L], Data), LL),
	columnN(LL, P, YL),
	write(sl(SL, LL)),nl,
	write(yl(YL, P)),nl,
	searchNaive(P,YL).
