formula:-
	/*
	% RN in 0..9,
	% RN #< B,
	% N * B #= N - A + RN 
	% labeling([], [A,B,RN]),
	*/

	F = 'result_visualisation/formula/formula.pl',
	open(F, read, Str),
	readData(Str,Data), 
