validate(R1,R2,R3,R4,R5,R7,L12):-
	write(mm(R1,R2,R3,R4,R5,R7)), nl,
	(X1-Y1) = R1,
	(X2-Y2) = R2,
	(X3-Y3) = R3,
	(X4-Y4) = R4,
	(X5-Y5) = R5,
	(X7-Y7) = R7,
	write(mm1(X1,Y1,X2,Y2)), nl,

	/*
	A1 in -9..9,
	B1 in -9..9,
	K1 in 0..9,
	K1 #< B1,
	K2 in 0..9,
	K2 #< B1,
	Y1 * B1 #= X1 - A1 + K1,
	Y2 * B1 #= X2 - A1 + K2,
	labeling([], [A1,B1,K1,K2]),
	write(soll(A,B,K1,K2)), nl.
	*/

	% findall(member(X-Y, L12), validate_facette(X,Y)).
	A1 = 0.1, B1 = 0,
	A2 = -0.1, B2 = 11,
	foreach(member(X-Y, L12), validate_facette1(X,Y,A1,B1)),  % sud-ouest
	foreach(member(X-Y, L12), validate_facette2(X,Y,A2,B2)),  % nord-est
	foreach(member(X-Y, L12), validate_facette3(X,Y,A3,B3)),      % nord-ouest
	foreach(member(X-Y, L12), validate_facette4(X,Y,A4,B4)).  % sud-est
	%validate_facette(10,120).
validate.

validate_facette1(X,Y,A,B) :-
	write(validate1(X,Y)),
	Y >= X * A + B -> write((true)), nl; write(f(false)),nl.
validate_facette.

validate_facette2(X,Y,A,B) :-
	write(validate2(X,Y)),
	Y =< X * A + B -> write((true)), nl; write(f(false)),nl.
validate_facette.

validate_facette3(X,Y,B) :-
	write(validate(X,Y)),
	X >= B -> write((true)), nl; write(f(false)),nl.
validate_facette_x.

generer(C1,C2,S,Points):-

	findall(R1-R2,member(tuple(R1,R2,S,_,_,_),Points),L12),

	write(s(S,L12)), nl,

	atom_concat('result_visualisation/images/', S, CC),
	atom_concat(CC, C1, CCC),
	atom_concat(CCC, '-', A1),
	atom_concat(A1, C2, A2),
	atom_concat(A2, '.tex', A3),
	
	open(A3, write, Stream),
	

	/* get min max 8 points */
	aggregate((min(X)-min(Y)), member(X-Y,L12), MIN),
	aggregate((max(X)-max(Y)), member(X-Y,L12), MAX),
	(MINX-MINY) = MIN,
	(MAXX-MAXY) = MAX,
	MAXN is max(MAXX, MAXY),

    aggregate((min(MINX)-min(Y)), member(MINX-Y,L12), R1),
    aggregate((min(MINX)-max(Y)), member(MINX-Y,L12), R2),

    aggregate((min(X)-max(MAXY)), member(X-MAXY,L12), R3),
    aggregate((max(X)-max(MAXY)), member(X-MAXY,L12), R4),

    aggregate((max(MAXX)-max(Y)), member(MAXX-Y,L12), R5),
    aggregate((max(MAXX)-min(Y)), member(MAXX-Y,L12), R6),

    aggregate((max(X)-min(MINY)), member(X-MINY,L12), R7),
    aggregate((min(X)-min(MINY)), member(X-MINY,L12), R8),
	

    /* append R1..R8 to R */
	append([R1], [R2], R12),
	append(R12, [R3], R13),
	append(R13, [R4], R14),
	append(R14, [R5], R15),
	append(R15, [R6], R16),
	append(R16, [R7], R17),
	append(R17, [R8], R),
		
	/* For testing output */
	write(mm(MIN)), nl,
	write(mm(MAX)), nl,
	write(rr(R1)), nl,
	write(rr(R2)), nl,
	write(rr(R3)), nl,
	write(rr(R4)), nl,
	write(rr(R5)), nl,
	write(rr(R6)), nl,
	write(rr(R7)), nl,
	write(rr(R8)), nl,
	write(rlist(R)), nl,

	/* Write tex file start */
	write(Stream,'\\documentclass{book}\n'),
	write(Stream,'\\usepackage{tikz}\n'),
	write(Stream,'\\begin{document}\n'),
	write(Stream,'\\title{Exemple}\n'),
	write(Stream,'\\begin{tikzpicture} [font=\\sffamily] \n'),

	format(Stream,'\\draw[step=1cm,gray] (-1,-1) grid(~w,~w);\n', [MAXN, MAXN]),

	%ticks
    format(Stream, '\\foreach \\x in {-1,0,1,...,~w} \n', MAXN),
    write(Stream, '    \\draw (\\x,1pt) -- (\\x,-3pt) \n'),
	write(Stream, '        node[anchor=north] {\\x}; \n'),
	
    format(Stream, '\\foreach \\y in {-1,0,2,...,~w} \n', MAXN),
    write(Stream, '    \\draw (1pt,\\y) -- (-3pt,\\y) \n'),
    write(Stream, '        node[anchor=east] {\\y}; \n'),
    

	%labels      
	atomic_list_concat(C11, '_', C1), atomic_list_concat(C11, '-', RC1),
	atomic_list_concat(C22, '_', C2), atomic_list_concat(C22, '-', RC2),
	format(Stream, '\\node[below=2cm, right=0.5cm] {\\large ~w}; \n', RC1),
	format(Stream, '\\node[rotate=90, above=2cm] {\\large ~w}; \n', RC2),
	format(Stream, '\\node[above=6.5cm] {\\large Size: ~w}; \n', S),

	/* draw points */
	foreach(member(X-Y, R), plot(X, Y, Stream)),
	foreach(member(XN-YN, L12), plot(XN,YN, Stream)),
	(X1-Y1) = R1,
	(X2-Y2) = R2,
	(X3-Y3) = R3,
	(X4-Y4) = R4,
	(X5-Y5) = R5,
	(X6-Y6) = R6,
	(X7-Y7) = R7,
	(X8-Y8) = R8,

	/* draw lines */
	format(Stream, '\\draw[line width=3pt][color=red] (~w,~w) -- (~w,~w); \n', [X1,Y1,X2,Y2]),
	format(Stream, '\\draw[line width=3pt][color=red] (~w,~w) -- (~w,~w); \n', [X2,Y2,X3,Y3]),
	format(Stream, '\\draw[line width=3pt][color=red] (~w,~w) -- (~w,~w); \n', [X3,Y3,X4,Y4]),
	format(Stream, '\\draw[line width=3pt][color=red] (~w,~w) -- (~w,~w); \n', [X4,Y4,X5,Y5]),
	format(Stream, '\\draw[line width=3pt][color=red] (~w,~w) -- (~w,~w); \n', [X5,Y5,X6,Y6]),
	format(Stream, '\\draw[line width=3pt][color=red] (~w,~w) -- (~w,~w); \n', [X6,Y6,X7,Y7]),
	format(Stream, '\\draw[line width=3pt][color=red] (~w,~w) -- (~w,~w); \n', [X7,Y7,X8,Y8]),

	/* end of latex file */
	write(Stream,'\\end{tikzpicture}\n'),
	write(Stream,'\\end{document}\n'),
	close(Stream),

	/* write to formula file */ 
	atom_concat('result_visualisation/formula/', 'formula.pl', FF),

	/* validate */ 
	validate(R1,R2,R3,R4,R5,R7,L12).

